import { Route, Routes, Link, NavLink, useLocation } from 'react-router-dom';

function App() {
  return (
    <>
    <nav>
      <ul>
        <li>
          <NavLink 
            to="/game"
            className={isActive ? "Active Game" : "Game"}
          >
          </NavLink>
        </li>
        <li>
          <NavLink 
            to="/instructions"
            className={isActive ? "Active Instructions" : "Instructions"}
          >
          </NavLink>
        </li>
      </ul>
    </nav>
    <Routes>
      <Route path ="/game" element={<Game/>}/>
      <Route path ="/instructions" element ={<Instructions/>}/>
    </Routes>
    </>
  );
}

export default App;
